import React from 'react'
import {Article} from './searchpage'
import SearchCard from './searchcard'

const SearchCards = (articles:Article[]) =>{
    return(
        <div>
            {
                articles.map((article)=>{
                    return <SearchCard {...article}/>
                })
            }
        </div>
    )
}
export default SearchCards
